import React from 'react';

const Lemmikud = ({ people }) => {
    return (
        <div className="container">
            <h2>People:</h2>
            <div className="row">
                {people.map((person, index) => (
                    <div className="col-md-4 mb-3" key={index}>
                        <div className="card">
                            <img src={picture instanceof File ? URL.createObjectURL(picture) : picture} className="card-img-top" />
                            <div className="card-body">
                                <h5 className="card-title">{person.name}</h5>
                                <p className="card-text">Phone: {person.phone}</p>
                                <p className="card-text">Education: {person.education}</p>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Lemmikud;
